        "SoundCloud Premier monetization": "SoundCloud Premier-Monetarisierung",
        "The following document outlines the terms of use of the SoundCloud Premier monetization program. Before joining SoundCloud Premier monetization, you’ll need to read, understand and agree to the terms of use.": "Das folgende Dokument enthält die Nutzungsbedingungen für das SoundCloud Premier-Monetarisierungsprogramm. Bevor du an der SoundCloud Premier-Monetarisierung teilnimmst, musst du die Nutzungsbedingungen lesen, verstehen und akzeptieren. ",
        "You determine which tracks to monetize.": "Du entscheidest, welche Tracks du monetarisieren möchtest.",
        "This is a non-exclusive agreement, so you retain the ownership of your tracks and may distribute them elsewhere. You have the right to remove your tracks and your other content from SoundCloud Premier monetization at any time.": "Im Rahmen der Vereinbarung gewährst du ein nicht ausschließliches Nutzungsrecht. Dies bedeutet, dass du Eigentümer deiner Tracks bleibst und sie auf anderen Plattformen vertreiben kannst. Du bist berechtigt, deine Tracks und deine anderen Inhalte jederzeit aus der SoundCloud Premier-Monetarisierung zu entfernen.",
        "You will receive monthly royalty statements that will be paid within 45 days.": "Du erhältst monatliche Tantiemenabrechnungen mit einer Zahlungsfrist von 45 Tagen.",
        "You are responsible for ensuring that your tracks and other content does not violate any intellectual property rights or copyrights.": "Du bist dafür verantwortlich, dass deine Tracks oder anderen Inhalte keine geistigen Eigentums- oder Urheberrechte verletzen.",
        "If you cancel your Pro subscription or receive a copyright strike, you will no longer have access to SoundCloud Premier monetization.": "Wenn du dein Pro-Abonnement kündigst oder aus Urheberrechtsgründen eine Verwarnung erhältst, verlierst du den Zugriff auf die SoundCloud Premier-Monetarisierung.",
        "If there are changes to SoundCloud Premier monetization, we will notify you by email with two weeks’ notice.": "Falls wir Änderungen an der SoundCloud Premier-Monetarisierung vornehmen, benachrichtigen wir dich zwei Wochen im Voraus per E-Mail.",
