        "View your Insights": "Sieh dir deine Insights an",
        "Sign up to make it official. With a free SoundCloud account you can save this track and start supporting your favorite artists.": "Registriere dich offiziell. Mit einem kostenlosen SoundCloud-Konto kannst du diesen Track speichern und deine Lieblingskünstler unterstützen.",
        "Sign up to make it official. With a free SoundCloud account you can save this album and start supporting your favorite artists.": "Registriere dich offiziell. Mit einem kostenlosen SoundCloud-Konto kannst du dieses Album speichern und deine Lieblingskünstler unterstützen.",
        "Sign up to make it official. With a free SoundCloud account you can save this playlist and start supporting your favorite artists.": "Registriere dich offiziell. Mit einem kostenlosen SoundCloud-Konto kannst du diese Playlist speichern und deine Lieblingskünstler unterstützen.",
