        "Mastering technology built into your workflow": "Mastering-Technologie als Teil deines Workflows",
        "As the last step of your upload flow, you can make any track release-ready in minutes for one low cost per master": "Im letzten Upload-Schritt kannst du deinen Track für wenig Geld in Minutenschnelle mastern, um ihn für das Release aufzubereiten.",
        "Optimized loudness and enhanced sonic quality": "Optimierte Lautstärke und verbesserte Tonqualität",
        "Pick from a custom suite of mastering styles that sculpt your song’s tonal balance and dynamic range while preserving its original intent. Mastering optimizes your songs specifically for streaming platforms *": "Triff deine Wahl aus einer maßgeschneiderten Palette von Mastering-Stilen, mit denen du die Klangbalance und den Dynamikbereich feinjustieren kannst, ohne deinen Style zu verfälschen. Mastering optimiert deine Songs speziell für Streaming-Plattformen *",
        "Music you can release with confidence": "Ein hochwertiges Release für deine Musik",
        "With Dolby’s technology merging art x science to deliver professional-sounding results, your work will be ready to be heard by the world": "Dolby vereint Kunst und Technik in einer professionellen Mastering-Lösung, die deinen Tracks zu einem glorreichen Release auf allen Plattformen weltweit verhilft.",
        "Hearing is believing": "Du glaubst es, wenn du's hörst",
        "Dolby has perfected its mastering technology through thousands of hours of music analysis and by working with professional engineers to replicate their process. By critically listening to your music the way an engineer does – identifying the details, the unique sections, and musical transitions that give your song its unique story arc – the audio technology preserves your original intent while delivering a final track that sounds wide, powerful and ready for streaming playback where it goes. This technology is specifically for tracks distributed to streaming platforms.": "Dolby hat seine Mastering-Technologie in stundenlanger Musikanalyse und in Zusammenarbeit mit Programmierprofis perfektioniert, um die Ergebnisse reproduzierbar zu machen. Bei dieser Audiotechnik wird deine Musik einer fachlichen Bewertung unterzogen, um die Details, die einzelnen Teile und die musikalischen Übergänge zu identifizieren, die den individuellen Spannungsbogen deines Tracks ausmachen. So wird dein Style beibehalten. Zugleich wird eine Master-Version erstellt, die ausdrucksstark und qualitativ hochwertig ist und auf allen Streaming-Plattformen abgespielt werden kann. Diese Technologie fokussiert besonders auf Tracks, die an Streaming-Plattformen geliefert werden.",
        "Non-streaming use cases may cause volume softening.": "Bei anderen Verwendungen als Streaming kann es zu einer Verminderung der Lautstärke kommen.",
        "Mastering on SoundCloud": "Mastering auf SoundCloud",
        "For a fraction of the cost, get your tracks release-ready for streaming platforms without ever leaving your SoundCloud account.": "Mach deine Tracks zu einem Bruchteil der Kosten für Streaming-Plattformen releasefertig, ohne dein SoundCloud-Konto verlassen zu müssen.",
        "Get Started": "Los geht's",
        "For more information on mastering, supported formats and available styles, please visit our <Link>Help Center</Link>": "Weitere Informationen zu Mastering, unterstützten Formaten und verfügbaren Stilen findest du in unserem <Link>Supportbereich</Link>",
        "Master tracks with [[planName]]": "Tracks mastern mit [[planName]]",
        "In addition to unlimited uploads, full stats, and tools to grow your audience, <Plan /> subscribers get 3 free masters every month and the option to purchase additional ones for a discounted price of $3.99 each.": "Zusätzlich zu unbegrenzten Uploads, umfassenden Statistiken und Tools zur Zielgruppenvergrößerung bekommen <Plan /> Abonnenten jeden Monat 3 Master-Tracks und die Option, zusätzliche zu einem vergünstigten Preis von je 3,99 $ zu erwerben.",
