        "<a href=\"[[route]]\" class=\"sc-link-dark\">[[username]]</a> shared this [[contentType]] with you": "[[contentType]] von <a href=\"[[route]]\" class=\"sc-link-dark\">[[username]]</a> mit dir geteilt",
        "We're having trouble processing payment for your subscription. To keep your plan active, [[[linkStart]]]please update your billing info[[[linkEnd]]] now.": "Bei der Abwicklung der Zahlung für dein Abonnement ist ein Problem aufgetreten. [[[linkStart]]]Bitte aktualisiere deine Rechnungsdaten[[[linkEnd]]], damit dein Abo aktiv bleibt.",
        "For a limited time, get 3 months of ad-free, offline listening [[[linkStart]]]for [[[price]]][[[linkEnd]]]": "Hol dir 3 Monate lang unsere werbefreie Offline-Wiedergabe [[[linkStart]]]für [[[price]]][[[linkEnd]]]. Nur für begrenzte Zeit.",
        "After multiple attempts, we were unable to process your payment so we had to downgrade you to a free plan. You can get back your offline and ad-free listening by upgrading now at [[[linkStart]]]soundcloud.com/go[[[linkEnd]]].": "Da wir mehrmals vergeblich versucht haben, deine Zahlung abzuwickeln, haben wir dein Abo nun auf ein kostenloses Konto umgestellt. Wenn du die werbefreie Offline-Wiedergabe wieder nutzen möchtest, musst du unter [[[linkStart]]]soundcloud.com/go[[[linkEnd]]] ein neues Abonnement abschließen.",
        "After multiple attempts, we were unable to process your payment so we had to downgrade you to a basic plan. You can get back your Pro features by upgrading now at [[[linkStart]]]soundcloud.com/pro[[[linkEnd]]].": "Da wir mehrmals vergeblich versucht haben, deine Zahlung abzuwickeln, haben wir dein Konto nun auf ein Standard-Abo umgestellt. Wenn du deine Pro-Funktionen zurückhaben möchtest, musst du unter [[[linkStart]]]soundcloud.com/pro[[[linkEnd]]] ein neues Abonnement abschließen.",
        "[[[boldStart]]]Save now on our best plan for artists.[[[boldEnd]]] Get unlimited uploads, exclusive tools, benefits, and more with [[planName]] for [[price]]/year. [[[linkStart]]]Redeem Now[[[linkEnd]]]": "[[[boldStart]]]Jetzt sparen mit unserem besten Künstler-Abo.[[[boldEnd]]] Erhalte unbegrenzte Uploads, exklusive Tools, Vorteile und mehr mit [[planName]] für [[price]]/Jahr. [[[linkStart]]]Jetzt einlösen[[[linkEnd]]]",
        "[[[boldStart]]]Now Available: [[[featureName]]].[[[boldEnd]]] Get heard by up to 100+ listeners on your next upload as a [[planName]] subscriber. [[[linkStart]]]Learn More[[[linkEnd]]]": "[[[boldStart]]]Jetzt Verfügbar: [[[featureName]]].[[[boldEnd]]] Dein nächster Upload als [[planName]] -Abonnent wird von mehr als 100 Hörern angehört. [[[linkStart]]]Mehr Erfahren[[[linkEnd]]]",
        "[[[boldStart]]]Now Available: [[[featureName]]].[[[boldEnd]]] Subscribe to [[planName]] to get your next upload heard by up to 100+ listeners. [[[linkStart]]]Start Today[[[linkEnd]]]": "[[[boldStart]]]Jetzt Verfügbar: [[[featureName]]].[[[boldEnd]]] Abonniere [[planName]] und dein nächster Upload wird von über 100 Hörern angehört. [[[linkStart]]]Starte Heute[[[linkEnd]]]",
        "Get [[[linkStart]]][[plan]][[[linkEnd]]] for [[[percentage]]]% off. Extended through [[[date]]]": "Hol dir [[[linkStart]]][[plan]][[[linkEnd]]] mit  [[[percentage]]]% Rabatt. Angebot verlängert bis zum [[[date]]]",
        "One week only: Get [[[linkStart]]][[plan]][[[linkEnd]]] for [[percentage]]% off": "Nur für eine Woche: Hol dir [[[linkStart]]][[plan]][[[linkEnd]]] mit [[percentage]]% Rabatt",
        "Don’t lose your student discount. [[[linkStart]]]Verify again by [[[endDate]]] to continue saving 50%[[[linkEnd]]]": "Lass dir deinen Studentenrabatt nicht entgehen. [[[linkStart]]]Weise bis zum [[[endDate]]] deinen Studentenstatus nach, um noch einmal 50 % zu sparen[[[linkEnd]]].",
        "Don’t lose your student discount. [[[linkStart]]]Verify again now to continue saving 50%[[[linkEnd]]]": "Lass dir deinen Studentenrabatt nicht entgehen. [[[linkStart]]]Weise deinen Studentenstatus nach, um noch einmal 50 % zu sparen[[[linkEnd]]].",
        "For a limited time, students get 3 months of ad-free, offline listening [[[linkStart]]]for [[[price]]][[[linkEnd]]]": "Studenten erhalten für eine begrenzte Zeit unsere werbefreie Offline-Wiedergabe [[[linkStart]]]für [[[price]]][[[linkEnd]]]",
        "Only [[[successfulTracks]]] out of [[[totalTracks]]] tracks were saved because the upload limit has been reached.[[[separator]]][[[tagStart]]]Upgrade[[[tagEnd]]] for unlimited uploads and try again.": "Nur [[[successfulTracks]]] von [[[totalTracks]]] Tracks wurden gespeichert, da das Upload-Limit erreicht wurde. [[[separator]]] [[[tagStart]]] Mit einem Upgrade[[[tagEnd]]] erhältst du ein unbegrenztes Upload-Kontingent und kannst es erneut versuchen.",
        "Only [[[tagStart]]]%d track[[[tagEnd]]] remains in your plan. Try uploading fewer tracks or upgrade for unlimited uploads.": ["In deinem Abonnement ist nur noch [[[tagStart]]]%dTrack [[[tagEnd]]] übrig. Du solltest versuchen, weniger hochzuladen. Alternativ stehen dir nach einem Upgrade unbegrenzte Uploads zur Verfügung.", "In deinem Abonnement sind nur noch [[[tagStart]]]%d Tracks[[[tagEnd]]] übrig. Du solltest versuchen, weniger hochzuladen. Alternativ stehen dir nach einem Upgrade unbegrenzte Uploads zur Verfügung."],
