        "Please read the following statements and check the boxes to confirm your agreement.": "Lies dir die folgenden Erklärungen durch und aktiviere die Kontrollkästchen, um deine Zustimmung zu erklären.",
        "I have a good faith belief that use of the copyrighted work described above is not authorized by the copyright owner, its agent or the law.": "Ich bin im guten Glauben, dass das oben beschriebene urheberrechtlich geschützte Werk ohne Genehmigung der Rechteinhaber oder deren Bevollmächtigter bzw. unter Verletzung der Gesetze verwendet wird.",
        "I confirm that the information in this notification is accurate.": "Ich bestätige hiermit, dass die Informationen in dieser Beschwerde zutreffend sind.",
        "I acknowledge that SoundCloud may suspend or disable my account if I make false, malicious or bad faith allegations of copyright infringement, and that I may also be liable for damages (including costs and attorney’s fees) incurred by SoundCloud, the alleged infringer, or the copyright owner or its authorized licensee as the result of any such allegations.": "Ich nehme zur Kenntnis, dass SoundCloud berechtigt ist, mein Konto zu schließen, sollte sich meine Beschwerde wegen Urheberrechtsverletzung als falsche, böswillige oder unredliche Unterstellung erweisen, und dass ich überdies für etwaige Schäden (einschließlich Anwaltskosten) hafte, die SoundCloud, dem mutmaßlichen Urheberrechtsverletzer, dem Urheberrechtsinhaber oder seinen autorisierten Lizenznehmern infolge solcher Unterstellungen entstehen.",
        "I confirm that I am the copyright owner or am authorised to act on behalf of the owner of an exclusive right that is allegedly infringed. Where I am making notice pursuant to the United States Digital Millennium Copyright Act U.S.C.17§512(c), I make this statement under penalty of perjury.": "Hiermit bestätige ich, dass ich entweder selbst Urheberrechtsinhaber oder dazu berechtigt bin, im Namen des ausschließlichen Rechteinhabers zu handeln, gegen dessen Rechte ein mutmaßlicher Verstoß vorliegt. Die Versicherungen im Rahmen meiner Beschwerde (Notice) nach Maßgabe des US-amerikanischen Millennium Copyright Act, U.S.C. 17, Paragraph 512(c) leiste ich an Eides statt.",
        "By submitting this takedown form, I agree to having my information in respect to my rights ownership and email address shared with the uploader in case of dispute. In no instance, will my postal address or telephone number be shared.": "Durch Einreichung dieses Deaktivierungsformulars stimme ich der Weitergabe meiner Daten hinsichtlich meines Urheberrechtsstatus sowie meiner E-Mail-Adresse an den Benutzer zu, der den Titel hochgeladen hat, für den Fall, dass dieser Einspruch einlegen möchte. Ich nehme zur Kenntnis, dass meine Postanschrift und Telefonnummer unter keinen Umständen offengelegt werden.",
        "Please sign with your full name. This box will act as your digital signature": "Bitte unterzeichne mit deinem Vor- und Nachnamen. Dieses Feld fungiert als digitale Unterschrift.",
        "Full name": "Vor- und Nachname",
