        "%d track has been reported successfully for review and will be processed within 24 hours.": ["%d Track wurde zur Prüfung gemeldet und wird innerhalb von 24 Stunden verarbeitet.", "%d Tracks wurden zur Prüfung gemeldet und werden innerhalb von 24 Stunden verarbeitet."],
