        "If you identify content on SoundCloud that you believe <b>infringes your copyright</b>, you can let us know here.": "Wenn du auf SoundCloud auf Inhalte stößt, von denen du glaubst, dass sie <b>gegen das Urheberrecht verstoßen</b>, kannst du uns dies hier melden.",
