        "SoundCloud on Mobile": "SoundCloud auf mobilen Geräten",
        "Our app for iPhone and iPad.<br>Made for you to hear more.": "Unsere App für iPhone und iPad.<br>... damit du mehr hörst.",
        "More trending tracks. More of your favorite artists. More of the music &amp; audio you love. The SoundCloud app lets you hear more of what you want to hear. Sounds good, doesn’t it?": "Mehr angesagte Tracks. Mehr von deinen Lieblingskünstlern. Mehr Musik und Audio, so, wie du es gerne hast. Über die SoundCloud-App kannst du mehr von dem hören, was du hören willst. Klingt gut, oder?",
        "More quick. More slick.<br>One thumb is all you need.": "Schneller. Smarter.<br>Ein Daumen reicht zur Benutzung.",
        "Tap to play and pause. Swipe to skip tracks. Slide the waveform to scrub. The app is beautifully simple to use. But your thumb won’t need to work too hard–it’s easier than ever to hear more of the world’s sounds.": "Zum Abspielen und Anhalten tippen. Zum Überspringen von Tracks wischen. Zum Scrubben über die Waveform reiben. Die App ist absolut benutzerfreundlich und schont deinen Daumen. So ist die Musik der ganzen Welt zum Greifen nah.",
        "More likes. More playlists.<br>All in one place.": "Mehr „Gefällt mir“. Mehr Playlists.<br>Alles an einem Ort.",
        "The tracks you’ve liked and discovered, and your favorite playlists can all be found in your Library. Which means you can listen to what you love again and again. And again.": "Du findest die Tracks, die du gelikt und entdeckt hast, sowie deine favorisierten Playlists in der Bibliothek. Hier kannst du dir deine Lieblingstitel immer wieder anhören.",
        "More upfront. More personal.<br>Straight from the source.": "Noch einfacher. Noch persönlicher.<br>Direkt von der Quelle.",
        "The Profile screen organizes the tracks, playlists and likes of everyone on SoundCloud. Whether they’re posting original music or liking and reposting tracks. The important stuff can all be found right up front.": "Die Profil-Ansicht bietet einen Überblick über Tracks, Playlists und Likes von SoundCloud-Nutzern. Ob sie nun eigene Musik posten oder Tracks mit „Gefällt mir“ markieren und reposten – die wichtigen Sachen findet man immer sofort auf den ersten Blick.",
        "Our app for Android.<br>Pocket the world’s sounds.": "Unsere App für Android.<br>Die Musik der ganzen Welt in deiner Tasche.",
        "Find new and trending music &amp; audio. Follow your favorite artists and friends. Create and share playlists. Explore every genre you can think of. Our app for Android makes it easy for you to hear what you want to hear.": "Finde neue und trendige Musik- und Audio-Tracks. Folge deinen Lieblingskünstlern und Freunden. Erstelle Playlists und teile sie. Erkunde jedes Genre, das du dir vorstellen kannst. Unsere App für Android macht es dir einfach, genau das zu hören, was du hören willst.",
        "Hear today’s latest.<br>Before it’s tomorrow’s greatest.": "Höre das Neuste von Heute.<br>Bevor es morgen alle hören.",
        "Tracks about to explode. Artists heading for fame. Breaking news and podcasts. The Explore screen lets you discover new and trending music &amp; audio. Finding new things to hear couldn’t be easier.": "Tracks kurz vor dem Durchbruch. Künstler auf dem Weg zum Ruhm. Aktuelle Nachrichten und Podcasts. Unter „Entdecken“ lernst du neue und angesagte Musik- und Audio-Tracks kennen. Noch nie war es so einfach, neue Musik zu finden.",
        "From BFFs to VIPs.<br>Follow whoever you want.": "BFF oder VIP?<br>Folge, wem du willst.",
        "Following friends and artists lets you hear everything they create and share. Play their favorites from your Feed. Or go to their Profile to get all the music &amp; audio they post and love in one place.": "Wenn du Freunden und Künstlern folgst, kannst du alles hören, was sie erstellen und teilen. Spiele ihre Favoriten über deinen Feed ab. Oder ruf ihr Profil auf, um sämtliche Musik- und Audio-Tracks, die sie lieben und posten, an einem Ort abzurufen.",
        "Can’t find the right playlist?<br>Make the perfect playlist.": "Du kannst die perfekte Playlist nicht finden?<br>Erstelle sie einfach selbst.",
        "Hear and like playlists made by others. Or create your own from scratch. Two hours of the latest techno tracks. An hour of rock anthems. An afternoon of nothing but your friend’s garage rock.<br>Whatever you want.": "Hör dir die Playlists von anderen an und markiere sie mit „Gefällt mir“. Oder erstelle einfach eine eigene. Zwei Stunden der neuesten Techno-Tracks. Eine Stunde Rock-Hymnen. Einen Nachmittag mit nichts als dem Garagensound deines Kumpels.<br>Was auch immer du willst.",
        "Thanks, all-the-way-to-the-bottom reader.<br>Nothing left to do now but<br>download the app.": "Danke für dein Durchhaltevermögen!<br>Jetzt musst du nur noch<br>die App herunterladen.",
        "Loading…": "Wird geladen...",
        "With a [[planPro]] plan, you’re in charge with quiet mode. Choose whether comments should be public, private, or not allowed. You can also show or hide stats.": "Mit einem [[planPro]]-Abo hast du Zugriff auf den stummen Modus: Entscheide, ob Kommentare öffentlich, privat oder nicht zulässig sein sollen und ob Statistiken angezeigt oder ausgeblendet werden sollen.",
        "With any Pro plan, you’re in charge with quiet mode; choose whether comments should be public, private, or not allowed, or show or hide stats.": "Mit jedem Pro-Abo hast du Zugriff auf den stummen Modus: Entscheide, ob Kommentare öffentlich, privat oder nicht zulässig sein sollen und ob Statistiken angezeigt oder ausgeblendet werden sollen.",
