        "License": "Lizenz",
        "You can select a license for each track you upload. The default setting is 'All Rights Reserved' but you can also choose to give your track a Creative Commons license.": "Du kannst für jeden Track, den du hochlädst, eine Lizenz auswählen. Die Standardeinstellung lautet „Alle Rechte vorbehalten“. Aber du kannst deinem Track auch die Creative Commons-Lizenz geben.",
        "Some rights reserved": "Einige Rechte vorbehalten",
