        "Attribution": "Namensnennung",
        "Allow others to distribute, display and perform your work—and derivative works based upon it—but for noncommercial purposes only.": "Erteile anderen die Erlaubnis, dein Werk und davon abgeleitete Werke zu verbreiten, zu präsentieren und aufzuführen, jedoch ausschließlich für nicht kommerzielle Zwecke.",
        "Noncommercial": "Nicht kommerziell",
