        "Use shift and the arrow up and down keys to change the volume.": "Die Lautstärke kannst du mit der Umschalttaste und den Pfeiltasten nach oben und unten steuern.",
        "Autoplay station": "Sender automatisch abspielen",
        "Hear related tracks based on what’s playing&nbsp;now.": "Ähnliche Track anhören, anhand dessen, was du gerade hörst.",
