        "SoundCloud Premier monetization is only available for your own original music. Covers, remixes, mixes, DJ sets, audio recordings or podcasts are not monetizable at this time.": "Die SoundCloud Premier-Monetarisierung ist nur für deine eigene Originalmusik verfügbar. Cover, Remixes, Mixes, DJ-Sets, Audioaufnahmen oder Podcasts sind derzeit nicht monetarisierbar.",
        "SoundCloud Premier monetization is only available for your own original music. Covers, remixes, mixes, DJ sets, audio recordings or podcasts are not monetizable at this time. If you attempt to monetize content that includes unlicensed samples, your track will be removed from SoundCloud.": "SoundCloud Premier-Monetarisierung ist nur für deine eigene Originalmusik verfügbar. Covers, Remixes, Mixes, DJ-Sets, Audioaufnahmen oder Podcasts sind derzeit nicht monetarisierbar. Solltest du versuchen, Inhalte zu monetarisieren, die nicht lizensierte Samples enthalten, wird dein Track von SoundCloud entfernt.",
