        "Looking to earn money on your SoundCloud tracks? You are able to do so with your artist subscription. Learn more on how to enable SoundCloud Monetization with SoundCloud for Artists [[[linkStart]]]here[[[linkEnd]]]!": "Du möchtest mit deinen SoundCloud-Tracks Geld verdienen? Dein Künstler-Abo ermöglicht es dir. Erfahre mehr darüber, wie du die Monetarisierung auf SoundCloud ermöglichst - mit SoundCloud für Künstler [[[linkStart]]]hier[[[linkEnd]]]!",
