        "We will send you your first payment to your PayPal account within 45 days of the end of the month in which you joined. After that, you can expect payments monthly.": "Die erste Auszahlung an dein PayPal-Konto wird innerhalb von 45 Tagen nach Ende jenes Monats veranlasst, in dem du dem Programm beigetreten bist. Alle weiteren Auszahlungen erhältst du im monatlichen Rhythmus.",
        "Other streaming platforms will take a bit longer to send the first payment - you can expect it within 105 days of the end of the month in which you distributed your release. After that, you can expect payments monthly.": "Auf anderen Streaming-Plattformen dauert es etwas länger, bis du die erste Auszahlung erhältst – in der Regel erfolgt sie innerhalb von 105 Tagen nach Ende jenes Monats, in dem du deinen Release vertrieben hast. Alle weiteren Auszahlungen erhältst du im monatlichen Rhythmus.",
