        "Share your new playlist": "Teile deine neue Playlist",
        "AD": "WERBUNG",
        "You don’t have to put your name in the track title": "Der Track-Titel muss nicht deinen Namen enthalten",
        "“I get so many messages from fans saying that they discovered me from SoundCloud. It’s really as simple as uploading a song and instantly connecting to the world.”": "„So viele Fans schreiben mir, dass sie mich von SoundCloud kennen. Alles, was du tun musst, ist einen Song hochzuladen, und schon steht dir die Welt offen.“",
        "“Music connects the whole world, so I saw my fanbase grow from just my city, to all over the country, and even overseas. SoundCloud is the perfect platform to get your creativity out there.”": "„Musik verbindet die ganze Welt. Ich habe miterlebt, wie sich meine Fangemeinde, die erst auf meine Stadt begrenzt war, auf das ganze Land und schließlich sogar aufs Ausland ausgedehnt hat. SoundCloud ist die ideale Plattform, um deiner Kreativität Raum zu verschaffen.“",
        "“SoundCloud is an essential tool for independent artists like myself. From the very beginning, it has provided me with a simple and effective way to share my music with the world!”": "„SoundCloud ist ein unverzichtbares Tool für freischaffende Künstler wie mich. Von Anfang an bot sich mir hier eine einfache, effektive Möglichkeit, meine Musik in alle Welt zu tragen.“",
        "“SoundCloud is a place for artists to share their art, grow their network, and create opportunities all while increasing their personal net worth.”": "„SoundCloud ist ein Ort, an dem Künstler ihre Werke zur Schau stellen können, die Chance haben, entdeckt zu werden, und gleichzeitig ihr Reinvermögen vergrößern können.“",
        "“SoundCloud allowed me to have a place I could instantly upload my songs and send my thoughts and feelings out to people all over the world in a simple way.”": "„SoundCloud hat mir eine Plattform geboten, auf der ich mit wenigen Klicks meine Songs hochladen und meine Gedanken und Gefühle mit Menschen in aller Welt teilen kann. Alles ganz unkompliziert.“",
        "“SoundCloud built a streamlined system that is essential for anyone in my line of work to have in their tool belt. SoundCloud gives artists who have an extensive body of work a home for their music.”": "„SoundCloud hat ein effizientes System entwickelt, das sich in meinem Metier als unverzichtbares Werkzeug erwiesen hat. SoundCloud gibt Künstlern mit beträchtlichem Œuvre ein Zuhause.“",
        "“When I first started putting my music out there, it was through SoundCloud because the platform makes it so easy to upload and share music so immediately and directly.”": "„Meine Musik habe ich das erste Mal auf SoundCloud veröffentlicht, weil es diese Plattform so leicht macht, Musik schnell und einfach hochzuladen und zu teilen.\"",
        "“SoundCloud has always been a huge platform to myself and other up and coming artists and labels. It’s been a great way for me to find, like, share my art and get feedback.”": "„SoundCloud war immer eine einzigartige Plattform für mich und andere aufstrebende Künstler und Labels. Es ist eine großartige Möglichkeit zum Suchen, Liken und Teilen meiner Kunst und um Feedback zu erhalten.“",
        "First upload to first album": "Vom ersten Upload zum ersten Album",
        "Share your tracks and access the tools you need to break through and build your legacy.": "Teile deine Tracks und entdecke die Tools, die du brauchst, um den Grundstein für eine bahnbrechende Karriere zu legen.",
        "Upload your first track": "Lade deinen ersten Track hoch",
        "Real-time stats": "Echtzeit-Statistiken",
        "See which fans are listening to your tracks the most and where your top fans are, all in real-time.": "Erfahre, welche Fans sich deine Tracks am häufigsten anhören und wo deine Top-Hörer herkommen – alles in Echtzeit.",
        "Find your community": "Finde deine Community",
        "Share your work with millions of daily active listeners or share a private link with a few very special people.": "Teile deine Werke mit Millionen von aktiven Hörern oder gib einen privaten Link an einen ausgewählten Personenkreis weiter.",
        "Connect directly with fans": "Direkter Kontakt zu deinen Fans",
        "With direct messaging and in-track comments, you can always be in touch with your fans, whether they are on your block or on the other side of the world.": "Mithilfe von Direktnachrichten und Track-Kommentaren kannst du den Kontakt zu deinen Fans aufrecht halten – egal, ob sie nur eine Straßenecke weiter oder am anderen Ende der Welt wohnen.",
        "Made here, played everywhere": "Von SoundCloud zum Welt-Hit",
        "Join the world’s most diverse community of creators, from those sharing their first track to buzzworthy acts. No matter where you’re at in your career, SoundCloud’s what’s next.": "Tritt der weltweit größten Community aus Musik-Creators bei – von Newcomern bis zu etablierten Stars. SoundCloud begleitet dich auf jedem Schritt deiner Karriere.",
        "Join Now": "Jetzt mitmachen",
        "Connect with fans and see who’s listening": "Tritt in Kontakt zu Fans und lerne sie kennen",
        "Uploading is just the beginning: SoundCloud gives you the tools to level up your career.": "Tracks hochzuladen, das ist erst der Anfang. SoundCloud gibt dir die Tools, mit denen du den Durchbruch schaffst.",
        "Share your tracks anywhere on the web": "Teile deine Tracks überall im Web",
        "Use the embed player and audio cards to share your tracks wherever your audience is: from music blogs to your Twitter stream.": "Mit dem eingebetteten Player und den Soundkarten kannst du deine Tracks dorthin bringen, wo sich dein Publikum tummelt: ob auf Musik-Blogs oder in deinem Twitter-Stream.",
        "Get to know and connect with your audience": "Lerne dein Publikum kennen und trete mit ihnen in Kontakt",
        "Measure your progress with stats and interact with your fans directly via comments and messages.": "Miss deinen Erfolg durch Analyse der Statistiken und interagiere in Kommentaren und Nachrichten mit deinen Fans.",
        "Take creator tools with you anytime and anywhere": "Nimm unsere Tools für Creator mit, wohin du auch gehst",
        "Whether you’re in the studio, at home or on a tour bus, keep your community humming with our mobile app for creators.": "Mit unserer App für Creator hältst du deine Community auf dem Laufenden, egal, ob du gerade im Studio, daheim oder auf Tournee im Bus bist.",
        "Try it free": "Kostenlos testen",
        "Learn more about Pro plans": "Weitere Informationen über Pro-Abos",
        "Drag and drop your tracks & albums here": "Lege deine Tracks und Alben per Drag-&-Drop hier ab",
