        "Here’s a guide to using the embedded players and icons that we’ve designed to help your original music &amp; audio be heard everywhere.": "Hier findest du eine Anleitung zum Verwenden der eingebetteten Player und Symbole. So können deine Musik- und Audio-Tracks überall gehört werden.",
        "Use social icons to promote your profile": "Verwende Symbole zum Promoten deines Profils",
        "Point people from around the world to your SoundCloud page.": "Verweise Leute aus der ganzen Welt auf deine SoundCloud-Seite.",
        "To embed an icon on your blog or website, copy and paste the code.": "Kopiere den Code und füge ihn zum Einbetten in deinen Blog oder deine Website ein.",
        "SoundCloud embedded player": "SoundCloud – eingebetteter Player",
        "Embedding our player lets you share individual tracks, playlists or your own profile on your website or blog.": "Mit unserem Player kannst du einzelne Tracks und Playlists oder dein eigenes Profil auf deiner Website oder deinem Blog einbetten.",
        "On the playlist, track or profile that you want people to hear, click the share button.": "Klicke auf der Playlist, auf dem Track oder auf dem Profil, das du freigeben möchtest, auf die Schaltfläche „Teilen“.",
        "You can also copy and paste the embed code. Using WordPress? We’ve supplied the code for that, too.": "Du kannst auch den Einbettungscode kopieren und einfügen. Und wenn du WordPress verwendest, gibt es auch dafür einen Code.",
        "Customize: click Edit to choose autoplay, artwork display, and the highlight color. To share the embedded player to social networks, click Share and select an icon, or copy and paste the player link.": "Personalisierung: Klicke auf „Bearbeiten“, um Autoplay, Cover-Anzeige und Hervorhebungsfarbe auszuwählen. Du kannst den eingebetteten Player auch in sozialen Netzwerken freigeben, indem du auf „Teilen“ klickst und das entsprechende Symbol wählst. Oder du kopierst einfach den Player-Link und fügst ihn ein.",
        "Straightforward? We hope so. But if you need more help, [[[linkStart]]]it’s here[[[linkEnd]]].": "Klar genug? Das hoffen wir. Aber wenn du weitere Hilfe brauchst, [[[linkStart]]]sind wir für dich da[[[linkEnd]]].",
