        "[[[boldStart]]]Exclusive Offer.[[[boldEnd]]] Try Next Pro for 30-day free to access exclusive tools, advanced insights, and have your next upload heard by up to 100+ listeners. [[[linkStart]]]Start Free Trial[[[linkEnd]]]": "[[[boldStart]]]Exklusives Angebot.[[[boldEnd]]] Teste kostenlos Next Pro für 30 Tage mit Zugriff auf exklusive Tools, erweiterte Insights und lasse deinen nächsten Upload von über 100 Hörern abspielen. [[[linkStart]]]Kostenlosen Test starten[[[linkEnd]]]",
