        "[[[boldStart]]]Exclusive Offer.[[[boldEnd]]] Claim your free Next Pro trial to unlock advanced artist features and get heard by more listeners. [[[linkStart]]]Get started[[[linkEnd]]]": "[[[boldStart]]]Exklusives Angebot.[[[boldEnd]]] Teste Next Pro, um erweiterte Künstler-Funktionalitäten zu erhalten und von mehr Hörern gehört zu werden. [[[linkStart]]]Starten[[[linkEnd]]]",
        "[[[boldStart]]]Your Next Pro trial is active![[[boldEnd]]] Upload a track or explore your membership page to get started. [[[linkStart]]]Learn more[[[linkEnd]]]": "[[[boldStart]]]Dein Test von Next Pro hat begonnen![[[boldEnd]]] Lade einen Track hoch, um einzusteigen, oder erkunde deine Mitgliedsseite. [[[linkStart]]]Mehr erfahren[[[linkEnd]]]",
        "[[[boldStart]]]Your Next Pro trial will end soon.[[[boldEnd]]] Reactivate your subscription for uninterrupted access to premium features. [[[linkStart]]]Edit subscription[[[linkEnd]]]": "[[[boldStart]]]Dein Test von Next Pro endet demnächst.[[[boldEnd]]] Reaktiviere dein Abonnement für einen ununterbrochenen Zugriff auf Premium-Funktionalitäten. [[[linkStart]]]Abonnement bearbeiten[[[linkEnd]]]",
