        "[[trackCount]] track": ["[[trackCount]] Track", "[[trackCount]] Tracks"],
        "Connect with the full list of artists in your scene, get unlimited uploads & unlock advanced insights.": "Stelle den Kontakt zur gesamten Künstlerliste in deiner Szene her, erhalte unbegrenzte Uploads und erweiterte Insights.",
        "Upgrade to Next Pro": "Upgrade auf Next Pro durchführen",
        "Why am I seeing this ad?": "Warum wird mir diese Werbung angezeigt?",
        "This has been directed to your profile based on your personal and demographic information. Regrettably, we were unable to retrieve the advertiser data and the parameters they used to target this ad. For more details or if you have any concerns, please feel free to reach out to us by [[[linkStart]]]sending a message[[[linkEnd]]].": "Dies wurde an dein Profil aufgrund deiner persönlichen und demographischen Informationen weitergegeben. Leider konnten wir nicht auf die Daten und Parameter der Werbetreibenden zugreifen, die für das Targetting dieser Werbung verwendet wurden. Kontaktiere uns für weitere Einzelheiten oder bei Problemen mit einer [[[linkStart]]]Nachricht[[[linkEnd]]].",
        "This [[[provider]]] ad has been directed to your profile based on the following information:": "Diese [[[provider]]]-Werbung wurde aufgrund folgender Information an dein Profil weitergegeben:",
        "Age: [[age]] or older": "Alter: [[age]] oder älter",
        "If this ad is inappropriate, please [[[linkStart]]]report it to us[[[linkEnd]]].": "Falls diese Werbung unpassend ist, bitte [[[linkStart]]]melde sie uns[[[linkEnd]]].",
        "Manage preferences": "Einstellungen verwalten",
