        "Fine-tune your [[[linkStart]]]advertising settings[[[linkEnd]]].": "Passe deine [[[linkStart]]]Werbungs-Einstellungen[[[linkEnd]]]an.",
        "Ads on SoundCloud": "Werbung auf SoundCloud",
        "Every time you see or hear an ad, artists get paid. They're how we keep SoundCloud free for listeners. Want to lose the interruptions? [[[linkStart]]]Go ad-free[[[linkEnd]]] and continue to support your favourite artists.": "Jedes Mal, wenn du dir einen Werbespot ansiehst oder anhörst, klingelt beim jeweiligen Interpreten die Kasse. Nur so kann die Nutzung von SoundCloud kostenfrei bleiben. Schluss mit Werbeunterbrechungen? [[[linkStart]]]Werbefrei Musik hören[[[linkEnd]]] und weiterhin deine Lieblingskünstler unterstützen.",
        "Ad": "Werbung",
        "[[currentAdIndex]] of [[adSessionSize]]": "[[currentAdIndex]] von [[adSessionSize]]",
        "This [[[advertiser]]] ad has been directed to your profile based on the following information:": "Diese [[[advertiser]]]-Werbung wurde aufgrund folgender Information an dein Profil weitergegeben:",
        "Comment added": "Kommentar hinzugefügt",
        "This track has been hidden because you have exceeded your upload limit.  [[[linkStart]]]Upgrade[[[linkEnd]]] to a [[subscriptionName]] plan to restore all hidden tracks and unlock unlimited uploads.": "Dieser Track wurde ausgeblendet, weil du dein Upload-Limit überschritten hast. Führe ein  [[[linkStart]]]Upgrade[[[linkEnd]]] auf ein [[subscriptionName]] -Abo aus, um versteckte Tracks wieder einzublenden und dir ein unbegrenztes Upload-Kontingent zu sichern.",
        "[[[strongStart]]]Important:[[[strongEnd]]] By sharing, you confirm that your track complies with our [[[termsOfUseLinkStart]]]Terms of use[[[termsOfUseLinkEnd]]] and doesn’t infringe anyone else’s rights. If in doubt, refer to the [[[copyrightLinkStart]]]Copyright information[[[copyrightLinkEnd]]] pages and [[[faqsLinkStart]]]FAQs[[[faqsLinkEnd]]] before uploading.": "[[[strongStart]]]Wichtig:[[[strongEnd]]] Durch das Teilen von Tracks bestätigst du, dass diese unsere [[[termsOfUseLinkStart]]]Nutzungsbedingungen[[[termsOfUseLinkEnd]]] erfüllen und dass die Rechte anderer nicht verletzt werden. Bei Unklarheiten solltest du vor dem Hochladen unsere Informationsseiten zum [[[copyrightLinkStart]]]Urheberrecht[[[copyrightLinkEnd]]] besuchen und unsere [[[faqsLinkStart]]]FAQs[[[faqsLinkEnd]]] lesen.",
        "[[[strongStart]]]Important:[[[strongEnd]]] By sharing, you confirm that your track complies with our [[[termsOfUseLinkStart]]]Terms of use[[[termsOfUseLinkEnd]]] and you don’t infringe anyone else’s rights. If in doubt, refer to the [[[copyrightLinkStart]]]Copyright information[[[copyrightLinkEnd]]] pages and [[[faqsLinkStart]]]FAQs[[[faqsLinkEnd]]] before uploading.": "[[[strongStart]]]Wichtig:[[[strongEnd]]] Durch das Teilen von Tracks bestätigst du, dass diese unsere [[[termsOfUseLinkStart]]]Nutzungsbedingungen[[[termsOfUseLinkEnd]]] erfüllen und dass die Rechte anderer nicht verletzt werden. Bei Unklarheiten solltest du vor dem Hochladen unsere Informationsseiten zum [[[copyrightLinkStart]]]Urheberrecht[[[copyrightLinkEnd]]] besuchen und unsere [[[faqsLinkStart]]]FAQs[[[faqsLinkEnd]]] lesen.",
