        "See how it works": "So funktioniert's",
        "Enable": "Aktivieren",
        "This track isn’t eligible for recommendation yet.": "Dieser Track steht noch nicht für eine Empfehlung zur Verfügung.",
        "For your track to be analyzed and recommended it must be under 10 minutes long and set to “public”. Try uploading a shorter version, or making it public.": "Damit dein Track analysiert und empfohlen werden kann, muss er unter 10 Minuten lang und \"öffentlich\" sein. Versuche, eine kürzere Version hochzuladen, oder ihn öffentlich zu machen.",
        "This track will be recommended to the right audience.": "Dieser Track wird der passenden Hörergruppe empfohlen.",
        "We’ve analyzed and shared this track for the next 7 days. <Break /> This feature is exclusive to [[planName]] subscribers.": "Wir haben diesen Track für die nächsten 7 Tage analysiert und geteilt. <Break /> Diese Funktionalität steht nur für [[planName]] -Abonnenten zur Verfügung.",
        "Profile Verification Submission Page::Enter a link.": "Gib einen Link ein.",
        "Profile Verification Submission Page::This URL is invalid.": "Diese URL ist ungültig.",
        "Profile Verification Submission Page::Are you sure? Once you submit you cannot apply again for 30 days and your display name should not be changed. Keep in mind your display name should reflect your artist/brand name.": "Bist du dir sicher? Sobald du mit dem Prozess beginnst, kannst du dich innerhalb der nächsten 30 Tage nicht erneut bewerben. Dein angezeigter Name sollte nicht geändert werden. Und denke bitte daran, dass dein angezeigter Name deinen Künstler-/Markennamen widergeben sollte.",
        "Profile Verification Submission Page::A maximum of 5 links can be added.": "Du kannst maximal 5 Links hinzufügen.",
        "Profile Verification Submission Page::Request verification": "Verifizierung beantragen",
        "Profile Verification Submission Page::You are eligible to apply for Verification at this time.": "Du kannst jetzt eine Verifizierung beantragen.",
        "Profile Verification Submission Page::Profile verification is for well-known creators on SoundCloud who are most at risk of impersonation, or are emerging as notable and highly searched for. SoundCloud holds the right to verify accounts at our discretion. If you apply for verification you must meet the following requirements at minimum:": "Die Profilverifizierung ist für bekannte Ersteller auf Soundcloud gedacht, die am stärksten durch Nachahmung bedroht sind oder als nennenswert bzw. oft gesucht auffallen. Soundcloud behält sich das Recht vor, Konten nach eigenem Gutdünken zu überprüfen. Du musst die folgenden Mindestanforderungen erfüllen, um einen Verfizierungsantrag stellen zu können:",
        "Profile Verification Submission Page::Notable": "Bemerkenswert",
        "Profile Verification Submission Page::Your account must represent a well-known and/or highly searched for Artist, Collective, DJ, Label, Curator or Podcaster.": "Dein Konto muss einen bekannten und/oder oft gesuchten Künstler, DJ, Kurator oder Podcaster bzw. ein bekanntes und/oder oft gesuchtes Kollektiv oder Label vertreten.",
        "Profile Verification Submission Page::Unique": "Einzigartig",
        "Profile Verification Submission Page::Your account must be the unique presence of an Artist, Collective, DJ, Label, Curator or Podcaster. We do not verify fan accounts or impersonators.": "Dein Konto muss die einzige Präsenz eines Künstlers, Kollektivs, DJs, Labels, Kurators oder Podcasters darstellen. Wir verifizieren keine von Fans oder Nachahmern erstellte Konten.",
        "Profile Verification Submission Page::Clear purpose and intent": "Klarer Zweck und Vorsatz",
        "Profile Verification Submission Page::Your account should not contain any misleading information and it must adhere to our [[[linkStart]]]terms of use[[[linkEnd]]].": "Dein Konto darf keine irreführenden Informationen enthalten und muss unsere [[[linkStart]]]Nutzungsbedingungen[[[linkEnd]]]einhalten.",
        "Profile Verification Submission Page::Complete": "Vollständig",
        "Profile Verification Submission Page::Your account must have a bio, profile photo and at least one track uploaded.": "Dein Konto muss über eine Kurzinfo, ein Profilbild und mindestens einen hochgeladenen Track verfügen.",
        "Profile Verification Submission Page::It could take up to 30 days for our team to review your request. If you are a [[planName]] subscriber your application review will be prioritized. SoundCloud reserves the right to remove verification due to any breach of terms and conditions. If you change your display name your verified status will be at risk and you may need to reapply.": "Unser Team benötigt möglicherweise bis zu 30 Tage, um deine Anfrage zu bearbeiten. Die Bearbeitung der Anfragen von Nutzern von [[planName]] wird priorisiert. Soundcloud behält sich das Recht vor, Verifizierungen aufgrund von Verstößen gegen die Nutzungsbedingungen zu entziehen. Falls du deinen angezeigten Namen änderst, beeinträchtigt das deinen Verifizierungsstatus und du musst eventuell einen neuen Antrag stellen.",
        "Profile Verification Submission Page::Name of artist/band/group your profile represents": "Name des Künstlers bzw. der Band/Gruppe, die dein Profil vertritt",
        "Profile Verification Submission Page::Additional links": "Zusätzliche Links",
        "Profile Verification Submission Page::Add links here to any press articles, web pages or social profiles that could help us to review your online presence.": "Füge hier Links zu Presseartikeln, Internetseiten und Profilen auf sozialen Medien ein, die uns die Überprüfung deiner Online-Präsenz erleichtern.",
        "Profile Verification Submission Page::Submitting a request does not guarantee verification": "Das Einsenden einer Anfrage ist keine Garantie für eine Verifizierung.",
